import React from "react";
import ReactDom from "react-dom/client";

class Car {
  constructor(name) {
    this.brand = name;
  }
}

const mycar = new Car("Ford");

const root = ReactDom.createRoot(document.getElementById("root"));
root.render(mycar.na);
